import React from 'react';
import logo from './logo.svg';
import './App.css';
import Customers from './components/customers/customers';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <h3>Gabriel Peter</h3>
      <h1>Welcome</h1>
      </header>
      <Customers/>
    </div>
  );
}

export default App;
